import React from 'react'
import {Container, Row, Col} from 'reactstrap';
import coinLogo from '../images/coingecko-logo.png';

export default function Logo() {
    return (
        <Container>
            <Row>
                <Col md="12">knsdanls</Col>
            </Row>
        </Container>
    )
}
